import "./UserInputList.css";

const UserInputList = (props) => {
  return (
    <div className="user-data">
      {!props.data.length === 0 &&
        props.data.map((userData) => (
          <div className="particular-data">
            {userData["user-name"]} ({userData["user-age"]} Years Old)
          </div>
        ))}
    </div>
  );
};

export default UserInputList;
